void SelectMCode(int r, ICMat &Code)
{

	if (r <= 15 && r >= 3)
	{
		if (r == 3)
			getCodeM3(Code);
		else if (r == 4)
			getCodeM4(Code);
		else if (r == 5)
			getCodeM5(Code);
		else if (r == 6)
			getCodeM6(Code);
		else if (r == 7)
			getCodeM7(Code);
		else if (r == 8)
			getCodeM8(Code);
		else if (r == 9)
			getCodeM9(Code);
		else if (r == 10)
			getCodeM10(Code);
		else if (r == 11)
			getCodeM11(Code);
		else if (r == 12)
			getCodeM12(Code);
		else if (r == 13)
			getCodeM13(Code);
		else if (r == 14)
			getCodeM14(Code);
		else
			getCodeM15(Code);
	}
	else if (r == 107)
	{
		int h_code[] = { 1,1,1,0,0,1,0 };
		Code.CopyFromHost(h_code, 7, 1, 1);
	}
	else if (r == 111)
	{
		int h_code[] = { 1,1,1,0,0,0,1,0,0,1,0 };
		Code.CopyFromHost(h_code, 11, 1, 1);
	}
	else if (r == 113)
	{
		int h_code[] = { 1,1,1,1,1,0,0,1,1,0,1,0,1 };
		Code.CopyFromHost(h_code, 13, 1, 1);
	}
	else
	{
		Code.Resize(pow(2, r), 1, 1);
	}

}

void SelectComplexCode(int r, FCMat& result)
{
	switch (r)
	{
	case 5:
		getComplexCode5(result); break;
	case 7:
		getComplexCode7(result); break;
	}
}


